import { Card, CardHeader } from '@material-ui/core'
import React from 'react'

const ProductSubtotal = () => {
  return (
    <div style={{ display: 'grid' }}>
      <Card>
        <CardHeader title='Cart Products'></CardHeader>
      </Card>
    </div>
  )
}

export default ProductSubtotal
